import React, { useState, useRef } from 'react';
import emailjs from '@emailjs/browser';

const Contact = () => {
  const formRef = useRef();
  const [formData, setFormData] = useState({ name: '', email: '', message: '' });
  const [showPopup, setShowPopup] = useState(false);

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleSubmit = (e) => {
    e.preventDefault();
    emailjs
      .sendForm('service_ln1b367', 'template_wgcza8i', formRef.current, 'T-hfPbdDWJ4vL7fyq')
      .then(() => {
        setShowPopup(true);
        setFormData({ name: '', email: '', message: '' });
      })
      .catch((err) => console.error(err));
  };

  return (
    <section className="min-h-screen p-10 bg-gray-100 flex flex-col items-center">
      <h2 className="text-4xl font-bold mb-12 text-center">Contact Me</h2>

      <div className="w-full max-w-6xl flex flex-col md:flex-row md:justify-between gap-12">
        {/* Contact Cards */}
        <div className="flex flex-col gap-8">
          {/* Email Card */}
          <div className="w-48 h-48 bg-white rounded-xl shadow-lg p-6 flex flex-col items-center justify-center text-center">
            <h3 className="text-xl font-semibold mb-2">Email</h3>
            <p className="mb-4 break-words">roshithakommana18@gmail.com</p>
            <a
              href="mailto:roshithakommana18@gmail.com"
              target="_blank"
              rel="noopener noreferrer"
              className="bg-purple-600 text-white px-4 py-2 rounded hover:bg-purple-700"
            >
              Send a Message
            </a>
          </div>

          {/* WhatsApp Card */}
          <div className="w-48 h-48 bg-white rounded-xl shadow-lg p-6 flex flex-col items-center justify-center text-center">
            <h3 className="text-xl font-semibold mb-2">WhatsApp</h3>
            <p className="mb-4">+91 63026 80957</p>
            <a
              href="https://wa.me/916302680957"
              target="_blank"
              rel="noopener noreferrer"
              className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700"
            >
              Send a Message
            </a>
          </div>
        </div>

        {/* Get in Touch Form - moved right */}
        <div className="flex-1 max-w-md ml-auto bg-white rounded-xl shadow-lg p-8">
          <h3 className="text-2xl font-semibold mb-4">Get in Touch</h3>
          <form ref={formRef} onSubmit={handleSubmit} className="flex flex-col gap-4">
            <input
              type="text"
              name="name"
              placeholder="Your Name"
              required
              value={formData.name}
              onChange={handleChange}
              className="border border-gray-300 rounded px-4 py-2 focus:outline-none focus:ring-2 focus:ring-purple-600"
            />
            <input
              type="email"
              name="email"
              placeholder="Your Email"
              required
              value={formData.email}
              onChange={handleChange}
              className="border border-gray-300 rounded px-4 py-2 focus:outline-none focus:ring-2 focus:ring-purple-600"
            />
            <textarea
              name="message"
              placeholder="Your Message"
              required
              rows={4}
              value={formData.message}
              onChange={handleChange}
              className="border border-gray-300 rounded px-4 py-2 focus:outline-none focus:ring-2 focus:ring-purple-600 resize-none"
            />
            <button
              type="submit"
              className="bg-purple-600 text-white px-6 py-3 rounded hover:bg-purple-700 font-semibold"
            >
              Send Message
            </button>
          </form>
        </div>
      </div>

      {showPopup && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white p-6 rounded-lg shadow-lg text-center">
            <p className="mb-4 font-semibold">Message Sent Successfully!</p>
            <button
              onClick={() => setShowPopup(false)}
              className="bg-purple-600 text-white px-4 py-2 rounded hover:bg-purple-700"
            >
              OK
            </button>
          </div>
        </div>
      )}
    </section>
  );
};

export default Contact;
